+// New creates a new GitHub provider with the given token.
+func New(token string) (*Provider, error) {
+	if token == "" {
+		return nil, &types.ExecutionError{
+			Code:        "GITHUB_TOKEN_REQUIRED",
+			Message:     "GitHub token is required",
+			Details:     nil,
+			Recoverable: false,
+			Timestamp:   time.Now(),
+			StackTrace:  "",
+		}
+	}
+
+	// Create HTTP client with token authentication
+	httpClient := &http.Client{
+		Transport:     tokenTransport{Token: token, Base: nil},
+		CheckRedirect: nil,
+		Jar:           nil,
+		Timeout:       0,
+	}
+
+	// Create GitHub client and enforce api.github.com only
+	client := github.NewClient(httpClient)
+
+	// Verify the base URL is github.com
+	if client.BaseURL.Host != "api.github.com" {
+		return nil, &types.ExecutionError{
+			Code:        "GITHUB_DOMAIN_NOT_ALLOWED",
+			Message:     "only api.github.com is allowed, got: " + client.BaseURL.Host,
+			Details:     map[string]any{"host": client.BaseURL.Host},
+			Recoverable: false,
+			Timestamp:   time.Now(),
+			StackTrace:  "",
+		}
+	}
+
+	return &Provider{
+		client: client,
+		token:  token,
+	}, nil
+}
